class Transaction:
    def __init__(self, transaction_type, amount, currency):
        self.transaction_type = transaction_type
        self.amount = amount
        self.currency = currency

    def __repr__(self):
        return f"Transaction('{self.transaction_type}', {self.amount}, '{self.currency}')"

class CashRegister:
    def __init__(self, cash_register_data):
        self.cash_register_data = cash_register_data

    def deposit(self, currency, amount):
        self.cash_register_data[currency] += amount
        print(f'Deposit {amount} {currency} to cash register')

    def withdraw(self, currency, amount):
        self.cash_register_data[currency] -= amount
        print(f'Withdraw {amount} {currency} from cash register')
    
    def print_cash_report(self):
        print(self.cash_register_data)

class MoneyExchange:
    def __init__(self, price_table, cash_register):
        self.price_table = price_table
        self.cash_register = cash_register
        self.success_transactions = []
        self.failed_transactions = []

    def make_transaction(self, transaction):
        buy, sell = self.price_table[transaction.currency][0], self.price_table[transaction.currency][1]
        instance_cash_register = self.cash_register     
        if transaction.transaction_type == 'SELL':                
            sell_currency_PLN = sell * float(transaction.amount)
            if self.is_possible(transaction, sell_currency_PLN):
                instance_cash_register.deposit('PLN', sell_currency_PLN)
                instance_cash_register.withdraw(transaction.currency, transaction.amount)
                self.success_transactions.append(transaction)
        if transaction.transaction_type == 'BUY':
            buy_currency_PLN = buy * float(transaction.amount)
            if self.is_possible(transaction, buy_currency_PLN):
                instance_cash_register.deposit(transaction.currency, transaction.amount)
                instance_cash_register.withdraw('PLN', buy_currency_PLN)
                self.success_transactions.append(transaction)
            else:
                y = cash_register_data['PLN']
                x = transaction, f'Not enough money [PLN], {y} < {buy_currency_PLN}'
                self.failed_transactions.append(x)

    def print_report(self):
        self.cash_register.print_cash_report()
        print(f'Success transactions: {self.success_transactions}')
        print(f'Total = {len(self.success_transactions)}')
        print(f'Failed transactions: {self.failed_transactions}')
        print(f'Total = {len(self.failed_transactions)}')
       
    def is_possible(self, transaction, buy_currency_PLN):
        instance_cash_register = self.cash_register
        if transaction.transaction_type == 'BUY':
            if buy_currency_PLN > instance_cash_register.cash_register_data['PLN']:
                print("Transaction NOT possible! Trying next one.")
                return False
        if instance_cash_register.cash_register_data[transaction.currency] > transaction.amount:
            print("Transaction possible. Processing.")
            return True

